window.bookSummaryJSON = "<p><b>Jack Rybicki is a high school senior who loves his girl, likes to party, and doesn't have much of a plan for his life.</b></p> <p>Then fate plucks him from obscurity and Jack, now renamed Jack Noble by his management team, becomes one of the most famous people on the planet.</p> <p>A teenager who likes to indulge himself with limitless resources is not the best recipe for a successful life.</p> <p>But, it's never too late in Middle Falls.</p> <p><b>Includes a special bonus note read by the author. Like all books in the series, it can be listened to as a standlone story.</b></p>"; 
